import React from "react";


class NumberRow extends React.Component {
	constructor(props) {
		super(props);
	}
	
    render() {
        let html = [];

        for (let index = 1; index <= 18; index++) {
            let value;
            let gridStyling = {
                gridRow: "0 / 0",
                gridColumn: index + " / " + index
            };

            if (index === 1) {
                value = (<div className="number firstRowNumber bolded centered" style={gridStyling}>
                             {index}
                         </div>);
            } 
            else if (index < 10) {
                value = (<div className="number numberRow bolded centered" styling={gridStyling}>
                             {index}
                         </div>);
            }
            else {
                value = (<div className="number doubleDigitNumberRow bolded centered" style={gridStyling}>
                             {index}
                         </div>);
            }

            html.push(value);
        }

        return (
            <div>
                <div className="rowOfNumbers">
                    {html}
                </div>
            </div>
		);
	}
}

class NumberColumn extends React.Component {
	constructor(props) {
		super(props);
	}
	
    render() {
        let html = [];

        for (let index = 1; index <= 7; index++) {
            let value;

            if (index === 1) {
                value = <div className="number firstColumnNumber bolded centered">{index}</div>;
            }
            else {
                value = <div className="number numberColumn bolded centered">{index}</div>;
            }

            html.push(value);
        }

        return (
            <div>
                <div className="columnOfNumbers">
                    {html}
                </div>
            </div>
		);
	}
}

export {NumberRow, NumberColumn}
